import React from 'react';
import "./style.scss";

import firstimg from   "../../images/Final Image 1.jpg";


export default function About() {
    return (
        <div className="about">
            <section className="about-heading">
                About 
            </section>
            <div className="about-content"> 
                 
                <section className="about-info">
                    I am a third year university student <br/> pursuing Computer Science. 
                    I have keen interest in Machine Learning, and Web Development. <br/>  
                    Always on the lookout for opportunites to learn, improve and  
                    further build expertise in the field. 
                </section>
                <section className="about-image">
                    <img src={firstimg} alt="image1"/>
                </section>
            </div>     
        </div>
    )
}
